import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const cardStyle = {
    margin: "8px",
    textDecoration: "none",
    color: "hsla(0,0%,100%,0.55)",
    fontSize: "24px",
    width: '18rem'
};

function About() {
    return (
        <Card style={ cardStyle }>
            <Card.Img variant="top" src="https://s1.1zoom.ru/big0/187/302174-Berserker.jpg" />
            <Card.Body>
                <Card.Title>Freightliner Truck</Card.Title>
                <Card.Text>
                    Cost: 50 000$
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
            </Card.Body>
        </Card>
    );
}

export default About;
